import React from 'react';
import styled from 'styled-components';

const Styles = styled.div`


    display: grid;
    justify-content: center;
    margin-top:5%;


.hey{
	font-size:5vw;
	font-family:'Permanent Marker';
	line-height:1.5em;
	background-color: grey;
  	color: black; 
  	font-weight: bold;
  	width: 100%;
  	text-align: center;
  	position: relative;
  	padding: 0 10px;
  	top:20%;
  	left: 50%;
  	margin-bottom:5%;
  	transform: translate(-50%, -50%);
  	mix-blend-mode: screen;
}
.name{

	font-family:'Gochi Hand';
	font-size:7vw;
	margin-left:2em;
	position:relative;
	display:inline-block;



}
.btm{
	 font:2vw 'Architects Daughter';
	 background-color:teal;
	 padding:0 3em;
	 text-align:center;
}
.how{
	font:2em 'Lobster';
	text-align:center;
}

@media screen and (max-width: 600px) {
  .btm {
    font-size:0.9em;
    padding:0 0.5em;
  }
  .how{
	font-size:1.5em;
}
}
`;

function Home() {
	return(
		<Styles>
		<div className='hey'>HELLO!</div>
		<span className='how'>How's it going?</span>
		I am
		<span className='name'>Bimarsha Khanal.</span><br/>
		<div class='btm'>
		-----Computer Engineering | Technophile | Autodidact-----
		</div>

		</Styles>

		);
}

export default Home;
